INSERT INTO `activity` (`id_activity`, `id_user`, `activity_name`, `description`, `tickets`, `start_ubication`, `end_ubication`, `price`, `image`, `date`, `city`, `company_name`, `company_website`, `start_coord`, `end_coord`, `state`, `scores`, `average_score`, `scorelist`) VALUES
(78, 22, 'Descubre el Barrio de las Letras', 'Bienvenidos al encantador Barrio de las Letras, en Madrid. Durante nuestro tour, exploraremos la rica historia literaria de esta pintoresca zona. Comenzaremos en la famosa Calle Cervantes 9, hogar del ilustre escritor Miguel de Cervantes. Recorreremos las estrechas calles adoquinadas, llenas de bares tradicionales y tiendas boutique. Podrán admirar la belleza de la Iglesia de las Trinitarias, donde yace la tumba de Cervantes. No olviden visitar el Museo del Prado, con su impresionante colección de arte, y finalizaremos nuestro recorrido en la vibrante Calle de Santa Catalina 1. ¡Una experiencia cultural inolvidable!', 14, 'Calle Cervantes 9, 28014, Madrid, Comunidad de Madrid, España', 'Calle de Santa Catalina 1, 28014, Madrid, Comunidad de Madrid, España', '15.00', 'images/6489de88aafb4.jpg', '2023-06-21 17:15:00', 'Madrid', 'GarciaTrip SL', 'Garciatrip.es', '40.41433372750434,-3.6976733719974018', '40.41593106835579,-3.697720497230457', NULL, 0, '0.0', NULL),
(79, 22, 'Viaje al Madrid de los Austrias', 'Bienvenidos al emblemático Madrid de los Austrias, un tesoro histórico en pleno corazón de la ciudad. Nuestro tour comienza en la encantadora Calle de Arrieta 6, donde se encuentra la imponente Plaza Mayor. Desde allí, nos adentraremos en las estrechas callejuelas empedradas, descubriendo joyas arquitectónicas como el Palacio Real y la Catedral de la Almudena. No pueden perderse la visita al Mercado de San Miguel, famoso por sus delicias gastronómicas. Continuaremos nuestro recorrido hasta llegar a la elegante Calle de Vergara 16, donde se sitúa el Convento de las Descalzas Reales. Un viaje fascinante al pasado imperial de Madrid que les dejará maravillados', 28, 'Calle de Arrieta 6, 28013, Madrid, Comunidad de Madrid, España', 'Calle de Vergara 16, 28013, Madrid, Comunidad de Madrid, España', '20.50', 'images/6489e141eba57.jpg', '2023-06-17 09:20:00', 'Madrid', 'GarciaTrip SL', 'Garciatrip.es', '40.41868953502384,-3.710300614803995', '40.417090600464476,-3.7118581617855644', NULL, 0, '0.0', NULL),
(80, 22, 'Descubre con nosotros el Barrio del Gotic', 'Bienvenidos al mágico Barrio Gótico de Barcelona, un lugar lleno de historia y encanto. Nuestro tour comenzará en el emblemático Carrer dels Banys Nous, donde nos sumergiremos en las estrechas calles medievales. Descubriremos la imponente Catedral de Barcelona, con su impresionante arquitectura gótica. Pasearemos por la Plaça Reial, con su ambiente animado y sus hermosos edificios. No podemos dejar de visitar el fascinante Museo Picasso, que alberga una extensa colección de obras del genio. Además, nos perderemos en el encanto del laberíntico Barri Gòtic, explorando sus plazas y rincones secretos. Finalmente, llegaremos a la Plaça Sant Jaume, donde se encuentran el Ayuntamiento y el Palau de la Generalitat. ¡Una experiencia cautivadora en el corazón histórico de Barcelona!', 12, 'Plaça de Sant Jaume 4, 08002, Barcelona, Cataluña, España', 'Pla de la Seu 3, 08002, Barcelona, Cataluña, España', '12.00', 'images/6489ec6b3487f.jpg', '2023-06-10 18:30:00', 'Barcelona', 'GarciaTrip SL', 'Garciatrip.es', '41.382649456313274,2.1768907974563456', '41.384245342666844,2.176030259451052', NULL, 0, '0.0', NULL),
(82, 22, 'La encantadora Plaza de España en Sevilla', 'Bienvenidos a la encantadora Plaza de España en Sevilla, un lugar emblemático que fusiona la arquitectura única con la historia de la ciudad. Rodeada de majestuosos edificios, la plaza es un verdadero tesoro. Sus hermosos azulejos representan las provincias españolas, mientras que los canales que la atraviesan ofrecen románticos paseos en barca. Podrán maravillarse con la imponente fuente central y explorar los jardines circundantes. No olviden visitar el Parque de María Luisa, donde encontrarán sombreados rincones y esculturas impresionantes. La Plaza de España es un lugar mágico que les transportará a otra época y les dejará recuerdos imborrables.', 45, 'Glorieta de San Diego, 41004, Sevilla, Andalucía, España', 'Calle Nicolás Alpériz, 41018, Sevilla, Andalucía, España', '25.00', 'images/6489f4d01eccc.jpg', '2023-08-14 19:05:00', 'Sevilla', 'GarciaTrip SL', 'Garciatrip.es', '37.379111112417455,-5.989223113516609', '37.376272060715166,-5.985362756109592', NULL, 0, '0.0', NULL),
(83, 22, 'Tour por el Alcázar, la Catedral y la Giralda', 'En este tour os impregnaréis de la magia de la capital andaluza visitando los tres monumentos más importantes de Sevilla: el Real Alcázar, la catedral de Santa María de la Sede y la Giralda, el símbolo de la ciudad.', 11, 'Calle Aire 5, 41004, Sevilla, Andalucía, España', 'Calle San Isidoro 10, 41004, Sevilla, Andalucía, España', '30.00', 'images/6489f75485310.jpg', '2023-03-28 19:00:00', 'Sevilla', 'GarciaTrip SL', 'Garciatrip.es', '37.38801122651085,-5.990512012830027', '37.38916202619946,-5.991970370072675', NULL, 1, '5.0', '[5.0, 4.0, 4.0, 3.0, 5.0]'),
(84, 22, 'Visita de la Sagrada Familia sin colas', 'Si hay un lugar que nadie puede perderse al visitar Barcelona es la Sagrada Familia. En esta visita descubriremos la obra maestra de Gaudí saltándonos sus interminables colas.', 13, 'Carrer de Provença, 08001, Barcelona, Cataluña, España', 'Carrer Provença, 08001, Barcelona, Cataluña, España', '50.00', 'images/648a0023199e0.jpg', '2023-07-26 10:10:00', 'Barcelona', 'GarciaTrip SL', 'Garciatrip.es', '41.40382182365002,2.1735601200113', '41.40388695681926,2.173704322931505', NULL, 0, '0.0', NULL),
(85, 21, 'Tour por Chueca y Malasaña', 'Nos encontraremos en la Plaza de la Luna, junto a la puerta de la Iglesia San Martin de Tours, para empezar a adentrarnos en dos de sus barrios más popualres. ¡Seguro que os sorprenden!\r\n\r\nComenzaremos el free tour callejeando rumbo al barrio de Malasaña mientras divisamos los teatros Lara y Alfil, la iglesia de San Antonio de los Alemanes y recorremos la calle del Pez. ¿Sabíais que en esta vía se encuentra uno de los bares malasañeros más típicos? \r\n\r\nEl paseo nos llevará hasta la plaza del Dos de Mayo, el corazón del barrio. En este punto se reúne gente de todo tipo para disfrutar de la Malasaña más auténtica. De hecho, cerca de aquí se encuentran algunos bares de copas que jugaron un papel crucial en la llamada Movida Madrileña de los años 80. ¡Conozcamos su historia!\r\n\r\nNos acercaremos después hasta el Museo de Historia de Madrid y, tras admirar su fachada barroca, pasearemos por la calle Fuencarral rumbo a Chueca. En el camino veremos los exteriores del mercado de San Ildefonso, la iglesia de San Antón y el convento de las Recogidas.\r\n\r\n¡Y llegamos a Chueca y su famosa plaza! Pasaremos frente a algunos de sus comercios más conocidos, muchos de ellos ligados a la cultura LGTBI. Y es que el barrio destaca claramente por su visibilización de este colectivo y su espíritu cosmopolita. \r\n\r\nFinalizaremos el free tour en la plaza del Rey mientras contemplamos la Casa de las Siete Chimeneas. ¿Sabéis qué misterios oculta? ¡También os lo contaremos!', 25, 'Calle de las Infantas, 28004, Madrid, Comunidad de Madrid, España', 'Calle de la Madera 19, 28004, Madrid, Comunidad de Madrid, España', '5.00', 'images/648a0275936ec.jpg', '2023-07-14 19:00:00', 'Madrid', 'Opentours Limited', 'Opentours.com', '40.420596771249315,-3.699287675377852', '40.42316872334199,-3.7047000222332453', NULL, 0, '0.0', NULL),
(86, 21, 'Tour de misterios y leyendas de Madrid', 'El casco antiguo de Madrid alberga grandes misterios de la Historia, enigmas que ocultan grandes secretos… ¿Os animáis a indagar en el pasado de la capital española?', 18, 'Carrera de San Jerónimo 22, 28014, Madrid, Comunidad de Madrid, España', 'Gran Vía 38, 28013, Madrid, Comunidad de Madrid, España', '5.00', 'images/648a03ecba076.webp', '2023-04-14 20:00:00', 'Madrid', 'Opentours Limited', 'Opentours.com', '40.41656488882334,-3.7003574855179675', '40.42022168402784,-3.704499077182946', NULL, 1, '5.0', '[5.0, 5.0, 5.0, 5.0, 5.0, 5.0, 5.0, 5.0, 5.0]'),
(91, 22, 'Visita a Madrid', 'Daremos un paseo por Madrid', 20, 'Calle de Toledo 35, 28005, Madrid, Comunidad de Madrid, España', 'Calle de Doctor Cortezo 1, 28012, Madrid, Comunidad de Madrid, España', '20.00', 'images/648af7b9b6751.jpg', '2023-06-20 13:37:00', 'Madrid', 'GarciaTrip SL', 'Garciatrip.es', '40.413240774795554,-3.7073622225169056', '40.413926951546955,-3.7032391578775603', NULL, 0, '0.0', NULL);

